import {Field, InjectedFormProps, reduxForm} from "redux-form";
import React from "react";
import {createField, Input} from "../../../Common/formControl/formControl";


type AddProductFormOwnProps = {}

const AddProductForm: React.FC<InjectedFormProps<AddProductFormValueType, AddProductFormOwnProps> & AddProductFormOwnProps> = ({handleSubmit}) => {
    return (
        <form onSubmit={handleSubmit}>
            <div>
                {createField<AddProductFormValueTypeKeys>('Name', 'name', Input)}

                Name:<Field component={'input'} name={'name'} placeholder={'name'}/>
            </div>
            <div>
                Collar:<Field component={'input'} name={'collar'} placeholder={'collar'}/>
            </div>
            <div>
                Width:<Field component={'input'} name={'width'} placeholder={'width'}/>
            </div>
            <div>
                Height:<Field component={'input'} name={'height'} placeholder={'height'}/>
            </div>
            <div>
                Count:<Field component={'input'} name={'count'} placeholder={'count'}/>
            </div>
            <div>
                Weight:<Field component={'input'} name={'weight'} placeholder={'weight'}/>
            </div>
            <button>Add Product</button>
        </form>
    )
}

export type AddProductFormValueType = {
    name: string,
    collar: string,
    width: string,
    height:string,
    count: number,
    weight: string,
}




type AddProductFormValueTypeKeys = Extract<keyof AddProductFormValueType, string>

// @ts-ignore
export const AddProductReduxForm = reduxForm<AddProductFormValueTypeKeys, AddProductFormOwnProps>({form: 'add-product'})(AddProductForm)
